var tipuesearch = {"pages":[{"title":"About","text":"沈孝錚 Shen, Shiau-Jeng 學歷 國立臺灣大學化學工程研究所 國立臺灣科技大學化學工程系 臺北市立松山工農化工科 興趣愛好 樂器演奏 音樂欣賞 閱讀專業書籍 逛街 寫code... 關於我啊... 我是一個碩士畢業的社會小白，本科是化學工程，不過因為之前的研究領域是使用 AspenPlus® 軟體做製程模擬的，剛好自身對於程式有些興趣， 因此有自學 python 這個程式語言，並且拿它來寫跟剛剛那個軟體做一些結合以及比較進階的應用，當然因為這語言的方便性，也去嘗試了像網路 爬蟲、AI領域方面，甚至是現在這個寫部落格也是@@ 該部落格是使用 Pelican 這個用 Python 編寫的靜態網頁生成器，想說是用這語言寫的比 較熟，或許會比較知道生成的機制吧~ 雖然學了一些程式，本人對自己的化工本業可是非常喜歡的呢，不然也不會從高中就開始念化工到研究所了 哈哈哈，希望之後可以在這領域好好 走下去，並且學習更多新的事物與精進電腦程式方面的技能。","tags":"pages","url":"/pages/about/","loc":"/pages/about/"},{"title":"show the picture","text":"","tags":"blogging","url":"/articles/2020/03/14/show-the-picture/","loc":"/articles/2020/03/14/show-the-picture/"},{"title":"Markdown Examples Part 1","text":"Basic markdown examples are shown below This text is bold This text is also bold ⋯ This text is italic This text is also italic This text is italic and bold An h1 heading An h2 heading An h3 heading... An h6 heading A list with numbers: 1. One 2. Two 3. Three A list with bullets: * Bullet * Bullet * Bullet Here's a blockquote: > Simple is better than complex Here's a table: Column1 Column 2 Column 3 Value 1 Value 2 Value 3 Value 4 Value 5 Value 6 Value 7 Value 8 Value 9 Here's a python script def login ( self ): # 先開啟起始網頁取得初始cookies取得權限 pre_web = self . rs . get ( self . pre_url , headers = self . nor_headers ) pre_cookies = requests . utils . dict_from_cookiejar ( self . rs . cookies ) # 登入學校系統 login_web = self . rs . post ( self . login_url , headers = self . nor_headers , data = self . login_data ) login_cookies = requests . utils . dict_from_cookiejar ( self . rs . cookies ) remove_cookie_by_name ( self . rs . cookies , 'PHPSESSID' ) # 不知道 cookie 多了不必要的PHPSESSID會不會怎樣，先刪除好了 # 檢查登入有沒有失敗 if login_web . url != self . search_url : raise LoginError ( '登入失敗!!!' ) return login_web","tags":"blogging","url":"/articles/2019/01/02/markdown-examples-part-1/","loc":"/articles/2019/01/02/markdown-examples-part-1/"},{"title":"Welcome to my blog!","text":"Welcome to my blog. This is a short page just to show how to put up a static page.","tags":"Intro","url":"/articles/2018/12/16/welcome/","loc":"/articles/2018/12/16/welcome/"},{"title":"My First Review","text":"Following is a review of my favorite mechanical keyboard.","tags":"Review","url":"/articles/2010/12/03/my-first-review/","loc":"/articles/2010/12/03/my-first-review/"}]};